import React from "react";
import axios from 'axios';

axios.get('http://localhost:8000/api/home')
  .then(function (response) {

    console.log(response);
  })
  .catch(function (error) {

    console.log(error);
  })
  .then(function () {
    // always executed
  });

function Home() {
   return (
        <h1>Home</h1>
   ) 
}


export default Home
